script: |
  super -f tsv -I q9540.sql | sort > q9540.out

vector: true

inputs:
  - name: q9540.sql
    data: |
      SELECT DISTINCT * FROM tab2 WHERE NOT + col0 - - col1 + - 60 >= col2 * col1 + + CAST ( 59 + + col1 AS REAL );
  - name: tab2

outputs:
  - name: q9540.out
    data: |
      46	51	23
      64	77	40
      75	67	58
